import React, { Component } from 'react';
// Icons
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome'
import { faBookmark, faBell, faUser, faSearch, faCaretDown } from '@fortawesome/free-solid-svg-icons'

export default class Nav extends Component {
  state = {
  }

  render () {
      return (
        <nav>
          <ul>
           <li><a href="/">Logo</a></li>
           <li><a href="/jobs">Jobs</a></li>
           <li><a href="/bookmarks"><span style={{verticalAlign: 'middle'}}><FontAwesomeIcon icon={faBookmark} /></span>&nbsp; Bookmarks</a></li>
           <li className="dropdown">
             <span id="nav-drop-link"><span><FontAwesomeIcon icon={faUser} /></span>&nbsp; Me <span className="dropdown-arr"><FontAwesomeIcon icon={faCaretDown} /></span></span>
             <div className="dropdown-content">
               <a href="/user-profile">Profile</a>
               <a href="/user-settings">Settings</a>
             </div>
           </li>
           <li><span id="search-icon-wrapper"><FontAwesomeIcon icon={faSearch} style={{verticalAlign: 'middle', color: '#8e8e8e', fontSize: 14 + 'px', marginBottom: 2.6 + 'px'}} /></span><input type="text" placeholder={"Search for a job..."} className="search"></input></li>
           <li><a href="/notfication"><span style={{verticalAlign: 'middle'}} id="noti-bell"><FontAwesomeIcon icon={faBell} /><div id="alert"></div></span></a></li>
          </ul>
        </nav>
      )
   }
}
